@mixin prop($colors...) {
  @content;
  @each $key, $value in $colors {
    @if $key == bg {
      @include bg-($value);
    }
    // ----------------
    @else if $key == t {
      @include t-($value);
    }
    // -------------------------------
    @else if $key == m {
      @include m-($value);
    }
    // ----------------
    @else if $key == mr {
      @include mr-($value);
    }
    // ----------------
    @else if $key == ml {
      @include ml-($value);
    }
    // ----------------
    @else if $key == mt {
      @include mt-($value);
    }
    // ----------------
    @else if $key == mb {
      @include mb-($value);
    }
    // -------------------------------
    @else if $key == p {
      @include p-($value);
    }
    // ----------------
    @else if $key == pr {
      @include pr-($value);
    }
    // ----------------
    @else if $key == pl {
