.col {
  @include breakpointMaker() {
    //-------------------symmetric----------------------------------//
    @each $key, $value in $numbers {
      &-#{$key} {
        // &.flex > * {
        //   -ms-flex: 0 0 100% / $key;
        //   flex: 0 0 100% / $key;
