        height: #{$key}px;
        // max-height: #{$key}px;
      }
    }
    // rem
    @each $key, $value in $numbers {
      &-#{$key} {
        height: #{$key}rem;
        // max-height: #{$key}rem;
      }
    }
    // %
    @for $i from 1 through 20 {
      &-#{$i*5}\% {
        height: $i * 5%;
      }
    }
    // vh
    @for $i from 1 through 20 {
      &-#{$i*5}vh {
        width: $i * 5vh;
      }
    }
    //  auto
    &-a {
      height: auto;
    }
  }
}

.min-h {
  @each $key in $number {
    &-#{$key} {
      min-height: #{$key}px;
      // height: 100%;
    }
  }
}
.max-h {
  @each $key in $number {
    &-#{$key} {
      height: 100%;
      max-height: #{$key}px;
    }
  }
}

